extension SinglyLinkedList {
    func hasCircle() -> Bool {
        var slowStep = head
        var quickStep = head?.next

        while let quick = quickStep, let slow = slowStep  {
            if quick === slow {
                return true
            } else {
                quickStep = quickStep?.next?.next
                slowStep = slowStep?.next
            }
        }

        return false
    }
}

